import React from "react";
import Post from "./Post/Post";

const posts = useSelector((state) => JSON.stringify(state.posts.posts));

const Posts = (posts) => {
    return (
        <div>
            {
                posts.map(
                    post => {
                        return <Post post={post}/>
                    } 
                )
            }
        </div>
    )
}

export default Posts;
